TITLE:
  - test membrane active strain material for gastric electromechanics
  - Here only the scatra field is computed. The ssi problem is afterwards
  - solved by reading the result of this scatra simulation from the
  - restart file and computing the structural field only. Controlled
  - via option SCATRA_FROM_RESTART_FILE.
PROBLEM TYPE:
  PROBLEMTYPE: "Scalar_Transport"
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 5
  NUMSTEP: 50
  INITIALFIELD: "field_by_function"
  INITFUNCNO: 1
  LINEAR_SOLVER: 1
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  EXPLPREDICT: true
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SOLVER 1:
  SOLVER: "UMFPACK"
  NAME: "Sca_Tra_Solver"
MATERIALS:
  - MAT: 11
    MAT_matlist_reactions:
      LOCAL: false
      NUMMAT: 3
      MATIDS: [12, 13, 14]
      NUMREAC: 3
      REACIDS: [110, 111, 112]
  - MAT: 12
    MAT_scatra:
      DIFFUSIVITY: 0
  - MAT: 13
    MAT_scatra:
      DIFFUSIVITY: 0
  - MAT: 14
    MAT_scatra:
      DIFFUSIVITY: 0
  - MAT: 110
    MAT_scatra_reaction:
      NUMSCAL: 3
      STOICH: [1, 0, 0]
      REACCOEFF: 1
      COUPLING: "simple_multiplicative"
      ROLE: [0, 1, 0]
  - MAT: 111
    MAT_scatra_reaction:
      NUMSCAL: 3
      STOICH: [0, 1, 0]
      REACCOEFF: 1
      COUPLING: "simple_multiplicative"
      ROLE: [0, 0, 1]
  - MAT: 112
    MAT_scatra_reaction:
      NUMSCAL: 3
      STOICH: [0, 0, 1]
      REACCOEFF: -12
      COUPLING: "simple_multiplicative"
      ROLE: [0, 1, 0]
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.795774715459477*(sin(x)*sin(y))"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.795774715459477*3*(cos(x+3*t)*sin(y+3*t)+sin(x+3*t)*cos(y+3*t))"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "(0.795774715459477*18)*(-sin(x+3*t)*sin(y+3*t)+cos(x+3*t)*cos(y+3*t))"
